import { createSlice } from "@reduxjs/toolkit";
import { Article } from "../models/Article";

const initialState = {
  articles: [
    {
      title: "Why Mclaren F1 Team is the next big contander",
      description:
        "How Mclaren turned it's operations around and is looking like the most likely contender to RedBull Racing F1",
      heroImage:
        "https://www.thepaddockmagazine.com/wp-content/uploads/2023/04/00001-1.jpeg",
      categories: ["Sports", "F1", "Cars"],
      author: "Test User",
      publishedAt: "15 January 2024",
      content:
        '<p><strong class="ql-size-large">Speed Side by Side</strong></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p>Alone this Season Redbull managed the Impossible of winning 22 out of 23 races, but who looks like the most likely challenger?</p><p><br></p><p><strong class="ql-size-large">It\'s Mclaren!!</strong></p><p>Lets Look at the Numbers</p><ul><li>345 kph (Redbull) vs 340 kph (Mclaren)</li></ul>',
    },
  ] as Article[],
};

export const newsSlice = createSlice({
  name: "news",
  initialState,
  reducers: {
    addNews: (state, action) => {
      state.articles.push(action.payload);
    },
  },
});

export const { addNews } = newsSlice.actions;

export const selectArticles = (state: any) => state.news.articles;

export default newsSlice.reducer;
